import ButtonContainer from "./ButtonContainer"
function Header(){
    return(
        <header>
            <div>
                <h1>React Developer</h1> 
                <h3> I love coding in react</h3>
            </div>
            <div>
               <ButtonContainer/> 
            </div>
        </header>
    )
}
export default Header;
